import { Box , InputBase, Button } from '@mui/material'

const Form = () => {

    return (
        <Box>
            <InputBase 
                placeholder="City"
            />

            <InputBase 
                placeholder=""
            />
            <Button>Get Weather</Button>
        </Box>
    )
} 

export default Form;
